import React from 'react'
import {Box,makeStyles, Typography} from '@material-ui/core'
import { borders } from '@material-ui/system';

const styleClass = makeStyles((theme)=>(
    {
        container:{
            display:"flex",
            alignItems:"center",
            justifyContent:"center",
            background:"linear-gradient(90deg, rgba(2,0,36,1) 0%, rgba(77,94,186,1) 36%, rgba(0,215,255,1) 100%)",
            height: window.innerHeight,
            flex:1,
            [theme.breakpoints.down("md")]:{
                display:"block"
            }
        },
        loginbox:{
            width:"35%",
            height:"70%",
            padding:"20px",
            display:"flex",
            background:"#FFFFFF",
            flexDirection:"row",
            justifyContent:"center",
            [theme.breakpoints.down("md")]:{
               width:"100%",
               border:"none",
               height:"100%"
            }
        },
        heading:{
            fontWeight:"900",
            fontSize:"28px"
        }
    }
))
const Login= ()=> {
    const styles=styleClass()
    return (
        <>
        <Box className={styles.container} >
            <Box border={2} borderColor="primary.main"  borderRadius={16} className={styles.loginbox}>
                <Typography className={styles.heading}>WELCOME TO BLOGSPOT</Typography>
                <Box className={styles.userdata}></Box>
                <Box className={styles.sociallogin}></Box>

            </Box>    
        </Box>
        </> 
    )
}

export default Login
